import React, { useState, useEffect } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import { usePlayer } from '../contexts/PlayerContext';
import ApiService from '../services/api';

function MusicPlayerPage() {
  const location = useLocation();
  const navigate = useNavigate();
  const { moods } = location.state || { moods: { happy: { intensity: 70 } } }; // –î–µ—Ñ–æ–ª—Ç–Ω–æ–µ –Ω–∞—Å—Ç—Ä–æ–µ–Ω–∏–µ
  const [playlists, setPlaylists] = useState([]);
  const { playTrack: playGlobalTrack, currentTrack, likedTracks, toggleLike, isLiked } = usePlayer();
  const [activeTab, setActiveTab] = useState('mood');
  const [note, setNote] = useState('');

  useEffect(() => {
    const moodTracks = {
      happy: ['–°–æ–ª–Ω–µ—á–Ω–∞—è –º–µ–ª–æ–¥–∏—è', '–†–∞–¥–æ—Å—Ç–Ω—ã–π —Ä–∏—Ç–º', '–ü–æ–∑–∏—Ç–∏–≤–Ω—ã–µ –≤–∏–±—Ä–∞—Ü–∏–∏'],
      sad: ['–ú–µ–ª–∞–Ω—Ö–æ–ª–∏—á–Ω–∞—è –±–∞–ª–ª–∞–¥–∞', '–ì—Ä—É—Å—Ç–Ω–∞—è –º–µ–ª–æ–¥–∏—è', '–ù–æ—Å—Ç–∞–ª—å–≥–∏—á–µ—Å–∫–∏–µ –Ω–æ—Ç—ã'],
      angry: ['–≠–Ω–µ—Ä–≥–∏—á–Ω—ã–π —Ä–æ–∫', '–ú–æ—â–Ω—ã–π –±–∏—Ç', '–ê–≥—Ä–µ—Å—Å–∏–≤–Ω—ã–µ —Ä–∏—Ñ—Ñ—ã'],
      calm: ['–†–∞—Å—Å–ª–∞–±–ª—è—é—â–∞—è –º—É–∑—ã–∫–∞', '–ú–µ–¥–∏—Ç–∞—Ç–∏–≤–Ω–∞—è –∫–æ–º–ø–æ–∑–∏—Ü–∏—è', '–£–º–∏—Ä–æ—Ç–≤–æ—Ä—è—é—â–∏–µ –∑–≤—É–∫–∏'],
      excited: ['–î—Ä–∞–π–≤–æ–≤—ã–π —Ç—Ä–µ–∫', '–¢–∞–Ω—Ü–µ–≤–∞–ª—å–Ω—ã–π —Ö–∏—Ç', '–≠–ª–µ–∫—Ç—Ä–æ–Ω–Ω—ã–µ –±–∏—Ç—ã'],
      anxious: ['–£—Å–ø–æ–∫–∞–∏–≤–∞—é—â–∞—è –º—É–∑—ã–∫–∞', '–ú—è–≥–∫–∞—è –º–µ–ª–æ–¥–∏—è', '–ê–Ω—Ç–∏—Å—Ç—Ä–µ—Å—Å —Ç—Ä–µ–∫'],
      love: ['–†–æ–º–∞–Ω—Ç–∏—á–µ—Å–∫–∞—è –º–µ–ª–æ–¥–∏—è', '–õ—é–±–æ–≤–Ω–∞—è –±–∞–ª–ª–∞–¥–∞', '–ù–µ–∂–Ω—ã–µ –Ω–æ—Ç—ã'],
      tired: ['–°–ø–æ–∫–æ–π–Ω–∞—è –∫–æ–º–ø–æ–∑–∏—Ü–∏—è', '–†–∞—Å—Å–ª–∞–±–ª—è—é—â–∏–µ –∑–≤—É–∫–∏', '–ú–µ–¥–ª–µ–Ω–Ω–∞—è –º–µ–ª–æ–¥–∏—è']
    };

    const selectedMoods = Object.keys(moods);
    const mainMood = selectedMoods[0] || 'happy';

    const mockPlaylists = [
      {
        id: 1,
        title: `–ú—É–∑—ã–∫–∞ –¥–ª—è ${mainMood}`,
        tracks: moodTracks[mainMood] || moodTracks.happy
      }
    ];
    setPlaylists(mockPlaylists);
  }, [moods]);

  const playTrack = (playlist, trackIndex) => {
    playGlobalTrack(playlist.tracks[trackIndex]);
  };

  const saveToDiary = async () => {
    if (!currentTrack) {
      alert('–í—ã–±–µ—Ä–∏—Ç–µ —Ç—Ä–µ–∫ –¥–ª—è —Å–æ—Ö—Ä–∞–Ω–µ–Ω–∏—è');
      return;
    }

    const entry = {
      date: new Date().toISOString(),
      moods,
      music: { track: currentTrack, playlist: '–í—ã–±—Ä–∞–Ω–Ω–∞—è –º—É–∑—ã–∫–∞' },
      note
    };

    try {
      await ApiService.createDiaryEntry(entry);
      alert('–ó–∞–ø–∏—Å—å —Å–æ—Ö—Ä–∞–Ω–µ–Ω–∞ –≤ –¥–Ω–µ–≤–Ω–∏–∫!');
    } catch (error) {
      const entries = JSON.parse(localStorage.getItem('diaryEntries') || '[]');
      entries.unshift({ id: Date.now(), ...entry });
      localStorage.setItem('diaryEntries', JSON.stringify(entries));
      alert('–ó–∞–ø–∏—Å—å —Å–æ—Ö—Ä–∞–Ω–µ–Ω–∞ –ª–æ–∫–∞–ª—å–Ω–æ!');
    }

    navigate('/diary');
  };

  return (
    <div className="container">
      <div className="header">
        <h2 style={{ color: 'white', marginBottom: '20px' }}>–ú—É–∑—ã–∫–∞</h2>
      </div>

      <div style={{ 
        marginBottom: '30px', 
        display: 'flex', 
        justifyContent: 'center', 
        gap: '15px',
        flexWrap: 'wrap'
      }}>
        <button 
          className={activeTab === 'mood' ? 'btn btn-primary' : 'btn btn-secondary'}
          onClick={() => setActiveTab('mood')}
          style={{ minWidth: '120px', width: 'auto' }}
        >
          üéµ –ü–æ –Ω–∞—Å—Ç—Ä–æ–µ–Ω–∏—é
        </button>
        <button 
          className={activeTab === 'liked' ? 'btn btn-primary' : 'btn btn-secondary'}
          onClick={() => setActiveTab('liked')}
          style={{ minWidth: '120px', width: 'auto' }}
        >
          ‚ù§Ô∏è –ü–æ–Ω—Ä–∞–≤–∏–≤—à–∏–µ—Å—è
        </button>
      </div>

      {activeTab === 'mood' ? (
        playlists.map(playlist => (
